        <Route path="/login" exact element={<LoginPage/>} />
        <Route path="/selection" exact element={<SelectionPage/>} />
        <Route path="/payment" exact element={<PaymentPage/>} />
        {/* <Route path="/plan" exact element={<PlanPage/>} /> */}
      </Routes>
    </Elements>  
    </>
  );
}

export default App;
